#include <iostream>
#include <string>
using namespace std;

int main() {
    string s;
    cin >> s;

    for (char c : s) {
        if (c < 'a' || c > 'z') {
            cout << "Invalid!" << endl;
            return 0;
        }
    }

    int count = 0;
    for (char c : s) {
        if (c == 'a' || c == 'e' || c == 'i' || c == 'o' || c == 'u') {
            count++;
        }
    }

    cout << count << endl;
    return 0;
}

